import React, { useEffect, useState } from 'react';
import './index.css';
const Temp = () => {
    const [city, setCity] = useState();
    const [search, setSearch] = useState("Mumbai");

    useEffect( () =>{
        const fetchApi = async () =>{
            const url = `http://api.openweathermap.org/data/2.5/weather?q=${search}&appid=5d78e9c609add345ae7d9b999ab9bca2`;
            const response = await fetch(url);
            const resJson = await response.json();
            console.log(resJson);

        }

        fetchApi();
    } )
    return (
        <>
            <div className="box">
                <div className="inputData">
                    <input
                        type="Search"
                        className="inputField"
                        onChange={(event) => {

                        }} />
                </div>
                <div className="info">
                    <h2 className="location">
                        <i className="fa fa-street-view" aria-hidden="true"></i>Jehanabad
                    </h2>
                    <h1 className="temp">
                        5.25°Cel
                    </h1>
                    <h3 className="tempmin_max">Min : 5.35°cel | Max : 4.45°cel</h3>
                </div>
            </div>
        </>
    )
}

export default Temp;


